import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState(0);
  const arrays = () => {
    const ary = [...Array(5)].map((_,i) => i+1);
    return ary
  }
  const logs = ()=>{
    setName(name+1);
    arrays();
  }
  const moreName = [1,2,3,4];
  return (
    <div>
      <h2>増えるボタン</h2>
      {moreName.map((counkey:number) => {
        return <div className="divbtn" onClick={logs} key={counkey.toString()}>{name}</div>
      })}
    </div>
  );
}

export default AddButton;
